import React, { Component} from "react";
import "./Register.css";
import Cookies from 'js-cookie';

class Connect extends Component {

  render(){
    return (
    <div>
        <h1>Vous êtes connecté</h1>;
        <Link to='/sign-in'>
                    <button className="button-register"  to='/sign-in'>Disconect</button>
        </Link>
    </div>
    );
  }
}
export default Connect;
